import "./ExpensesItem.css";

function ExpensesItem() {
  return (
    <div className="container flex">
      <div className="date item">December 2021</div>
      <div className="items item">
        <h2>SIP</h2>
        <div className="price">$100</div>
      </div>
    </div>
  );
}

export default ExpensesItem;
